    try {
      const response = await API.get("/insurance");
      setFilms(response.data);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    loadFilms();
  }, []);

  return (
    <>
      <div className="container mt-5">
        <div className="film-header">
          <h3>All Films</h3>
        </div>
        <div className="card ">
          <div className="card-body card-fund">
